    return(
       <div className="video">
            <video controls width="250" poster={props.activeVideo.image}></video>
            <img src="../assets/Icons/play.svg" alt="playicon" className="video__playicon"></img>
            <img src="../assets/Icons/volume_up.svg" alt="volupicon" className="video__volupicon"></img>
       </div>
    );
}
export default Video;
